  movie_description: "Frozen lấy cảm hứng từ câu chuyện Nữ Hoàng Tuyết được nhà văn Andersen chắp bút nhưng nội dung hoàn toàn khác so với tác phẩm gốc. Phim tạo nên cơn sốt hơn 1,2 tỷ $ trên toàn thế giới vào năm 2013. Sau 6 năm, bộ phim ra mắt phần 2 trong sự chờ đợi tột cùng của khán giả.\r\n\r\nElsa, Anna, Kristoff và Olaf đi sâu vào rừng để tìm hiểu sự thật về bí ẩn xảy ra nơi vương quốc của họ. Đó là khu rừng thần bí mà hoàng hậu đã từng kể cho hai nàng công chúa khi còn nhỏ. Liệu điều này có liên quan gì đến sức mạnh của Elsa. Điều gì đang chờ đợi họ khi vén màn sự thật?"
