  movie_name: "ANH TRAI YÊU QUÁI"
  movie_description: "Lâm là một vận động viên Judo quốc gia bỗng chốc phải bỏ dở sự nghiệp vì gặp chấn thương mất đi thị giác. Phong - người anh cùng cha khác mẹ đang ở trong tù - ngay lập tức lợi dụng bi kịch của em trai để xin được ân xá về nhà chăm sóc em. Chưa thể chấp nhận sự thật mình sẽ bị mù vĩnh viễn, Lâm càng phát điên khi ông anh 10 năm không gặp bỗng dưng trở về, mang theo toàn phiền toái. Cuộc đoàn tụ không mong muốn đẩy hai anh em Phong và Lâm vào những tình huống bi hài, khi vừa phải chịu đựng tật xấu của nhau, vừa tìm cách giải quyết những mâu thuẫn trong quá khứ."
