  movie_description: "Với thông điệp: “Thiện Căn ở tại lòng ta - Chữ Tâm kia mới bằng ba chữ Tài”, bộ phim điện ảnh với thể loại linh dị - hài ‘Pháp Sư Mù’ sẽ tái hiện hành trình đi tìm lại ánh sáng cho đôi mắt của Tinh lâm và những câu chuyện nhân quả đan xen mà Tinh Lâm phải trải qua để thấu hiểu rõ hơn về cuộc đời. Tinh Lâm bị mù là do tai nạn hay có nguyên nhân bí ẩn nào khác? Ai sẽ cùng đồng hành với Tinh Lâm để tiếp tục con đường “trừ ma diệt quỷ”? Tất cả sẽ được giải đáp thỏa đáng vào ngày 08.11.2019 tới đây."
